INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_256","喷雾消毒报警,低水位开关检测不到信号","No signal detected for low water level switch","Alarma de desinfección por pulverización, el interruptor de bajo nivel de agua no puede detectar la señal","Сиг. дезин. спреем, выкл. низ. ур. воды не обна. сигнал","Alm de désinfection par pulvérisation, aucun signal détecté par l\'interrupteur de bas niveau d\'eau");
INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_257","喷雾消毒报警,高水位开关检测不到信号","No signal detected for high water level switch","Alarma de desinfección por pulverización, el interruptor de alto nivel de agua no puede detectar la señal","Сиг. дезин. спреем, выкл. выс. ур. воды не обна. сигнал","Alm de désinfection par pulvérisation, aucun signal détecté par l\'interrupteur de haut niveau d\'eau");
INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_258","喷雾消毒报警,高、低水位开关检测不到信号，缺药液","No signal detected for high/low water level switch. Liquid medicine lack","Alarma de desinfección por pulverización, los interruptores de nivel de agua alto/bajo no pueden detectar señales, falta reactivo","Сиг. дезин. спреем, выкл. низ. и выс. ур. воды не обна. сигнал, недост. жид.","Alm de désinfection par pulvérisation, aucun signal détecté par l\'interrupteur de haut niveau d\'eau et de bas niveau d\'eau, manque de solution");
INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_259","喷雾消毒报警,高水位开关检测信号脱不开","Detection signal not disengaged for high water level switch","Alarma de desinfección por pulverización, la señal de detección del interruptor de alto nivel de agua no se puede separar","Сиг. дезин. спреем, сигнал обна. выкл. выс. ур. воды не освоб.","Alm de désinfection par pulvérisation, non-déclenchement du signal de détect. de l\'interrupteur de haut niveau d\'eau");
INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_260","喷雾消毒报警,低水位开关检测信号脱不开","Detection signal not disengaged for low water level switch","Alarma de desinfección por pulverización, la señal de detección del interruptor de bajo nivel de agua no se puede separar","Сиг. дезин. спреем, сигнал обна. выкл. низ. ур. воды не освоб.","Alm de désinfection par pulvérisation, non-déclenchement du signal de détect. de l\'interrupteur de bas niveau d\'eau");
INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_261","喷雾消毒报警,高低水位开关检测信号脱不开，喷雾不正常","Detection signal not disengaged for high/low water level switch. Abnormal spray","Alarma de desinfección por pulverización, la señal de detección del interruptor de nivel de agua alto/bajo no se puede separar, la atomización es anormal","Сиг. дезин. спреем, сигнал обна. выкл. выс. и низ. ур. воды не освоб., ненор. расп.","Alm de désinfection par pulvérisation, non-déclenchement du signal de détect. de l\'interrupteur de haut niveau d\'eau et de bas niveau d\'eau, pulvérisation anormale");
INSERT into i18n(wkey,zh,en,sp,ru,fr) VALUES("12_262","喷雾消毒报警,加药电磁阀闭合不严","Dosing solenoid valve not closed","Alarma de desinfección por pulverización, la válvula solenoide dosificadora no está firmemente cerrada","Сиг. дезин. спреем, элект-маг. кл. доз. закрыт неплотно","Alm de désinfection par pulvérisation, l\'électrovanne de dosage n\'est pas bien fermée");
